  "id": 52116,
  "title": "Andrew Miller Building",
  "about": "<p>The central hub of the campus where it’s all happening! It houses our spacious library, cafes, shops, a bank, a pharmacy and a prayer room. It’s also a great meeting spot. The Atrium often plays host to an ever-changing line up of specialist stalls – from pop-up food to mini record fairs.</p>\n<ul>\n<li><a href=\"/student-life/campus-facilities/the-atrium/\">The atrium</a></li>\n<li><a href=\"/student-life/campus-facilities/the-library/\">The library</a></li>\n<li><a href=\"/student-life/campus-facilities/campus-transformation/\">Campus transformation</a></li>\n</ul>",
  "coord": "42, 15",
